B.ON=new A.b_(2,{title:"Mikroanatomi",konten:"Sistem saraf perifer terdiri dari reseptor sensoris dan serabut saraf yang berasal dari CNS Ganglion (pl. ganglia) \u2192 kumpulan soma yang menghubungkan PNS dan CNS\n\nJaringan ikat yang melapisi:\na) Epineurium: melapisi kumpulan fasikulus\nb) Perineurium: melapisi 1 fasikulus\nc) Endoneurium: melapisi kumpulan serabut saraf\n\n"},B.bD,t.o)
B.OL=new A.b_(2,{title:"Saraf Kranial",konten:"- N. Olfaktorius (Sensorik)\nberfungsi sebagai Saraf penghidu. Dimulai di dinding superior cavum nasi dan diteruskan ke bulbus olfaktorius\n- N. Optikus (Sensorik)\nberfungsi sebagai Saraf penglihatan. Dimulai di retina & diteruskan ke corpus genikulatum lateral di inferior talamus\n- N. Okulomotor (Motorik)\nterletak Dari mesensefalon & berujung di otot-otot penggerak bola mata\n- N. Trokhlear (Motorik)\nterletak Dari mesensefalon & berujung di otot penggerak bola mata\n- N. Trigeminus (Sensorik dan Motorik)\nBercabang 3: n. oftalmikus, n. maksilaris, n. mandibularis\nSensorik: berujung di reseptor sensorik wajah\nMotorik: berujung pada otot-otot pengunyah\n- N. Abdusens (Motorik)\nterletak Dari pons & berujung di otot penggerak bola mata.\n- N. Fasial (Sensorik dan motorik)  \nSensorik: berujung di reseptor rasa di lidah\nMotorik: berujung pada di otot2 wajah\n- N. Vestibulokokhlear (Sensorik)\nBerujung di kokhlea (saraf pendengaran) & organ vestibuler (sensor keseimbangan), keduanya di telinga dalam\n- N. Glosofaringeus (Sensorik dan Motorik)\nBerujung di otot-otot faring dan di reseptor rasa di lidah\n- N. vagus (Sensorik dan motorik)\nMotorik : berujung di palatum, faring, laring, bronkhus, trakhea, paru, jantung dan saluran pencernaan.\nSensorik : berujung di palatum, faring, laring, bronkhus, trakhea, paru, jantung, saluran pencernaan & telinga bagian luar \n- N. Aksesori (Motorik)\nBerujung di otot sternokleidomastoideus & otot trapezius, sebagian besar otot faring & palatum\n- N. Hipoglossus (motorik)\nBerujung di otot-otot lidah\n\n"},B.bD,t.o)
B.OQ=new A.b_(2,{title:"Saraf Spinalis",konten:"Berasal dari medulla spinalis, kemudian Bercabang menjadi Radix anterior, membawa serabut motoric. Badan sel terletak pada cornue anterior substansia grisea medulla spinalis Radix posterior, membawa serabut sensoris. Badan sel terletak di cornue posterior substansia grisea\nRadix anterior dan posterior bergabung membentuk nervus spinalis. Bercabang menjadi ramus ventral dan ramus dorsal \n\nRamus posterior\n- Inervasi columna vertebralis dan muskulus profunda dari punggung serta kulit sesuai dengan pola segmen dibawah\nRamus anterior\n- Inervasi region anterior dan lateral dari truncus, ekstremitas atas, dan ekstremitas bawah\n\nArea unilateral pada kulit diinervasi oleh serabut sensoris nervus spinalis disebut dengan dermatome\nArea unilateral pada muskulus diinervasi oleh serabut nervus spinalis disebut dengan myotome\n\n"},B.bD,t.o)
B.OS=new A.b_(2,{title:"Sistem Saraf Autonom",konten:"Sistem saraf autonomy terdiri dari serabut motoris yang menstimulasi terjadinya gerakan involunter.\n\nPerbedaan simpatis dan parasimpatis:\n- Lokasi badan sel presinaps\n- Sistem konduksi serabut presinaps berasal dari sistem saraf pusat\n\nKedua neuron postsinaps tersebut melepaskan eurotransmitter yang berbeda\n### Divisi Simpatis\n\nIntermediolateral Cell Column (IMLs)\nIML terletak di substansia grisea T1-T12 dan L1-L2 \u2192 thoracolumbar\n\nBadan sel postsinaps:\n- Ganglia paravertebral\n- Ganglia prevertebral\n\nSimpatis: meningkatkan metabolism\n\n\u201cfight, flight, or fright\u201d or \u201cfight, flight or freeze\u201d\n\nJalan serabut sinaps didalam trunkus simpaticus:\n- Berjalan ascenden kemudian bersinapas\n- Bersinaps ditempat masuk\n- Berjalan descenden kemudian bersinaps\n- Berjalan langsung didalam trunkus simpaticus tanpa bersinaps kemudian menginervasi organ viscera abdominopelvic\n\n### Divisi Parasimpatis\n\nBadan sel serabut parasimpatis terletak:\n- Substansia grisea batang otak \u2192 kepala, CN.III, CN.VII, IX, X\n- Substansia grisea medulla spinalis segmen sakralis (S2-S4) \u2192 organ viscera pelvis\n\nHanya menginervasi organ viscera\nSerabut presinaps sangat panjang (effector-ganglion didekat organ)\nSerabut postsinaps sangat pendek (ganglion-organ)\n"},B.bD,t.o)
